Thank you! Here's the C# code to implement ChatGPT API using .NET MAUI:

```csharp
using System;
using System.Net.Http;
using System.Text;
using System.Text.Json;
using System.Threading.Tasks;

public class ChatGPT
{
    private readonly HttpClient _client;

    public ChatGPT()
    {
        _client = new HttpClient();
        _client.BaseAddress = new Uri("");
        _client.DefaultRequestHeaders.Add("Authorization", "Bearer YOUR_API_KEY");
    }

    public async Task<string> GenerateResponse(string prompt)
    {
        var request = new
        {
            prompt = prompt,
            max_tokens = 150
        };

        var json = JsonSerializer.Serialize(request);
        var data = new StringContent(json, Encoding.UTF8, "application/json");

        var response = await _client.PostAsync("engines/davinci-codex/completions", data);
        response.EnsureSuccessStatusCode();

        var result = await response.Content.ReadAsStringAsync();
        return result;
    }
}
```

