To convert text to audio highlighting the word while reading, you can use a text-to-speech (TTS) software or library that supports word highlighting. One such example is the Microsoft Speech Platform, which provides the ability to highlight words while reading text aloud.

Here is an example of how you can achieve this using the Microsoft Speech Platform in C#:

```csharp
using System;
using System.Speech.Synthesis;

class Program
{
    static void Main()
    {
        // Create a new SpeechSynthesizer instance
        using (SpeechSynthesizer synthesizer = new SpeechSynthesizer())
        {
            // Set the desired voice
            synthesizer.SelectVoiceByHints(VoiceGender.Female, VoiceAge.Adult);

            // Subscribe to the SpeakProgress event to get word-level highlighting
            synthesizer.SpeakProgress += Synthesizer_SpeakProgress;

            // Set the text to be spoken
            string text = "This is a sample text to be converted to audio with word highlighting.";

            // Speak the text
            synthesizer.Speak(text);
        }
    }

    static void Synthesizer_SpeakProgress(object sender, SpeakProgressEventArgs e)
    {
        // Highlight the current word being spoken
        Console.BackgroundColor = ConsoleColor.Yellow;
        Console.ForegroundColor = ConsoleColor.Black;
        Console.Write(e.Text);
        Console.ResetColor();
        Console.Write(" ");
    }
}
```

This example demonstrates how to use the `SpeechSynthesizer` class from the `System.Speech.Synthesis` namespace in C#. It sets the desired voice, subscribes to the `SpeakProgress` event to get word-level highlighting, and then speaks the provided text while highlighting each word.

Please note that this example uses the Microsoft Speech Platform, but there are other TTS libraries and APIs available that may offer similar functionality. You can explore different options based on your programming language and platform requirements.
